import React,{Fragment,useEffect,useState} from "react";

const ListEvent = () => {

    const [events, setEvent] = useState([]);

    const getEvent = async() => {
        try {

            const response = await fetch("http://localhost:4000/events")
            const jsonData = await response.json()

            setEvent(jsonData);
        } catch (err) {
            console.error(err.message);
        }
    }

    useEffect(() => {
        getEvent();
    },[ ])


    return (
      <Fragment>
        <div class="container">
          <h2 className="text-center mt-5 text-center">List of upcoming Events</h2>

          <table class="table">
            <thead>
              <tr>
                <th>Name</th>
                <th>Description</th>
                <th>Location</th>
                <th>Date</th>
                <th>Edit</th>
                <th>Delete</th>
              </tr>
            </thead>
            <tbody>
              {/* <tr>
                <td>John</td>
                <td>Doe</td>
                <td>john@example.com</td>
              </tr> */}




            </tbody>
          </table>
        </div>
      </Fragment>
    );
};

export default ListEvent;
